def str_str(haystack, needle)
  return 0 if needle.empty?

  haystack.each_char.each_with_index do |ch, i|
    break if i + needle.size > haystack.size
    match = true
    needle.each_char.each_with_index do |cn, j|
      unless haystack[i + j] == cn && haystack[i + j] == cn
        match = false
        break
      end
    end

    return i if match
  end

  return -1
end

puts "INCORRECT" unless str_str("", "") == 0
puts "INCORRECT" unless str_str("abc", "d") == -1
puts "INCORRECT" unless str_str("foobar", "bar") == 3
puts "INCORRECT" unless str_str("foobarbarbar", "bar") == 3
puts "INCORRECT" unless str_str("baaaaaaaaaaaaaa", "aaaaaaaaaaaaaa") == 1
puts "INCORRECT" unless str_str("", "") == -1
